import React from 'react'
import ReactApexChart from 'react-apexcharts'

function Chart4() {

  const series= [70,10],
  options= {
    chart: {
      height: 350,
      type: 'radialBar',
    },
    plotOptions: {
      radialBar: {
        hollow: {
          size: '70%',
        }
      },
    },
    labels: ['Cricket' , 'Sccocer'],
  }

    return (
        <div>
            <ReactApexChart options={options} series={series} type="radialBar" height={350} />
        </div>
    )
}

export default Chart4
